import React from 'react'
import pic from '../Media/Group 9671.png'
import { Stack, Typography } from '@mui/material'
export default function WhyUs() {
  return (
    <div style={{backgroundColor:'#7D4896',position:'relative',}}>
      <Stack  direction="row"
            gap={7}
            sx={{
                 display: 'flex', flexWrap: 'wrap', justifyContent: 'center', alignItems: 'center',padding:'20px' }}>
        <Typography>
            hello 
        </Typography>
        <img src={pic} style={{height:'450px',width:'300px',position:'absolute',right:'0px',top:'50%'}}/>
      </Stack>
    </div>
  )
}
